import Link from 'next/link'

function Home() {
  return (

          <div >
      <link rel="stylesheet" href="//cdn.jsdelivr.net/npm/semantic-ui@2.4.2/dist/semantic.min.css" />
      <h1 class="ui header">
        <img src="data:image/png;base64,"></img>
        WelcomeIN</h1>
      <div class="ui inverted menu">
      <a class="active item">
        Home
      </a>
      <Link href="/users">
          <a className="item">
          Authroized Individuals
            </a>
        </Link>
        <Link href="/settings">
          <a className="item">
          Notification Settings            </a>
        </Link>
        <Link href="/footage">
          <a className="item">
          Footage
            </a>
        </Link>

    </div>
    </div>
  )
}

export default Home

